const backendDomain = 'http://localhost:3001';

export const authApi = {
    register: {
        url: `${backendDomain}/api/auth/register`,
        method: 'post'
    },
    login: {
        url: `${backendDomain}/api/auth/login`,
        method: 'post'
    }
}
